jQuery.noConflict()(function ($) {
  function b() {
    $(".grid").masonry({ itemSelector: ".grid-item" });
  }
  document.addEventListener("DOMContentLoaded", function () {
    window.addEventListener("scroll", function () {
      var b = document.querySelector(".top-header").offsetHeight;
      if ($(window).width() >= 992)
        window.scrollY > b
          ? document.getElementById("masthead").classList.add("fixed-header")
          : document
              .getElementById("masthead")
              .classList.remove("fixed-header");
      else {
        var c = document.querySelector(".bottom-header").offsetHeight,
          d = b + c;
        window.scrollY > d
          ? document.getElementById("masthead").classList.add("fixed-header")
          : document
              .getElementById("masthead")
              .classList.remove("fixed-header");
      }
    });
  });
  $(document).on("click", ".header-search-icon .search-icon", function (b) {
    b.preventDefault();
    $(".header-search-form").addClass("search-in");
  });
  $("body, .search-close").click(function (b) {
    if (!$(b.target).is(".header-search-form input")) {
      $(".header-search-form").removeClass("search-in");
    }
  });
  $("#navigation").slicknav({
    duration: 500,
    closedSymbol: '<i class="fas fa-plus"></i>',
    openedSymbol: '<i class="fas fa-minus"></i>',
    prependTo: ".mobile-menu-container",
    allowParentLinks: !0,
    nestedParentLinks: !1,
    label: "Menu",
    closeOnClick: !0,
  });
  $(function () {
    $(".input-date-picker").datepicker();
  });
  $(".home-slider").slick({
    dots: !1,
    infinite: !0,
    autoplay: !1,
    speed: 1200,
    fade: !0,
    slidesToShow: 1,
    slidesToScroll: 1,
    adaptiveHeight: !1,
  });
  $(".client-slider").slick({
    dots: !1,
    infinite: !0,
    speed: 1e3,
    prevArrow: !1,
    nextArrow: !1,
    slidesToShow: 5,
    autoplay: !1,
    responsive: [
      { breakpoint: 768, settings: { slidesToShow: 3 } },
      { breakpoint: 479, settings: { slidesToShow: 2 } },
    ],
  });
  $(".testimonial-slider").slick({
    dots: !0,
    infinite: !0,
    autoplay: !1,
    speed: 1200,
    slidesToShow: 1,
    slidesToScroll: 1,
    adaptiveHeight: !1,
    prevArrow: !1,
    nextArrow: !1,
  });
  $(window).scroll(function () {
    if ($(this).scrollTop() > 300) {
      $("#backTotop").fadeIn(200);
    } else {
      $("#backTotop").fadeOut(200);
    }
  });
  $("#backTotop").click(function (b) {
    b.preventDefault();
    $("html, body").animate({ scrollTop: 0 }, 1e3);
  });
  $(document).ready(function () {
    loopcounter("time-counter");
  });
  $(".single-tour-slider").slick({
    dots: !0,
    infinite: !0,
    autoplay: !1,
    speed: 1200,
    slidesToShow: 2,
    adaptiveHeight: !1,
    prevArrow: !1,
    nextArrow: !1,
  });
  $(".choice-slider").slick({
    dots: !1,
    infinite: !0,
    autoplay: !1,
    speed: 1200,
    fade: !0,
    slidesToShow: 1,
    slidesToScroll: 1,
    adaptiveHeight: !1,
  });
  $(".product-thumbnails").slick({
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: !1,
    fade: !0,
    asNavFor: ".product-thumb-nav",
  });
  $(".product-thumb-nav").slick({
    slidesToShow: 4,
    slidesToScroll: 1,
    asNavFor: ".product-thumbnails",
    dots: !1,
    centerMode: !0,
    focusOnSelect: !0,
  });
  $(window).load(function () {
    $("#siteLoader").fadeOut(500);
    b();
  });
  $(window).resize(function () {
    b();
  });
  $("#slider-range").slider({
    range: "max",
    min: 0,
    max: 1e3,
    value: 500,
    slide: function (b, c) {
      $("#maxAmount").val(c.value);
    },
  });
  $("#maxAmount").val($("#slider-range").slider("value"));
  $("#video-container").modalVideo({
    youtube: { controls: 0, nocookie: !0 },
  });
  $(".counter").counterUp();
  $(".quantity").prop("disabled", !0);
  $(document).on("click", ".plus-btn", function (b) {
    b.preventDefault();
    $(".quantity").val(parseInt($(".quantity").val()) + 1);
  });
  $(document).on("click", ".minus-btn", function (b) {
    b.preventDefault();
    $(".quantity").val(parseInt($(".quantity").val()) - 1);
    if ($(".quantity").val() == 0) {
      $(".quantity").val(1);
    }
  });
});
